import React, { Component } from 'react'
import Navbar from "../components/Navbar"
import Container from "../components/HomeContainer"
import EmailForm from "../components/Email"
import Footer from "../components/Footer"
import HomeContainer from '../components/HomeContainer'

const components = {
    "Home": <HomeContainer />,
    "Email": <EmailForm />
}

class Home extends Component {
    constructor(props) {
        super(props)
        this.state = {
            email: false,
            whichComponentToShow: 'Home'
        }
    }

    emailForm = () => {
        this.setState({
            whichComponentToShow: "Email",
            email: true
        })
    }
    homeContents = () => {
        this.setState({
            whichComponentToShow: "Home"
        })

    }

    whatToRender = (props) => {
        console.log("these are the props", props)
        if (props === 'Home') {
            return (
                <div>
                    <HomeContainer />
                </div>
            )
        } else if (props === 'Email') {
            return (
                <div>
                    <EmailForm />
                </div>
            )
        } else if (this.state.whichComponentToShow === 'Machine') {
            return (

                <div>
                    <Container />
                </div>
            )
        }
    }
    renderComponent(props) {
        console.log("hi", props)
        switch (props) {
            case "Home":
                return <HomeContainer />
            case "Email":
                return <EmailForm />
        }
    }
    showComponent(componentName) {
        this.setState({displayedTable: componentName});
      }



    render() {
        return (
            <div>
                <Navbar changeComponent={this.renderComponent} whatToshow={this.state.whichComponentToShow} emailForm={this.emailForm} homeContents={this.homeContents}>
                </Navbar >

                {/* {(this.state.email) ? <Container /> : <EmailForm />} */}
                <div>
                    {components[this.state.renderComponent]}
                </div>



                <Footer>
                </Footer>
            </div>
        )
    }
}
export default Home;
